import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="Total-header">
        <p>
            Total case:<br />
            30
        </p>
      </header>
      <header className="List-header">
        <p>
            France: 30<br />
            Italie: 30<br />
            Allemagne: 30<br />
        </p>
      </header>
      <header className="List-header">
        <p>
            France: 30<br />
